// 查询出所有城市
(function(){
	$.ajax({
        type: "POST",
        url: Context.PATH+ '/common/allcity.html',
        dataType: "json",
        success: function (response, textStatus, xhr) {
           Context.CITYDATA=response;
        }
    });
}());

var _cityNum;
// 绑定输入框值改变事件
$(document).on("input", "input[search='city']", function (e) {
	var input=$(this);
	_cityNum=input.attr("citynum");
	showPYMatchList(input);
	
});
//移除绑定事件，防止重复绑定
$(document).off("click", "#searchCityList li a");
$(document).off("click", "input[name='city']");
//绑定下拉选择单击事件
$(document).on("click", "#searchCityList li a", function () {
    var cityId = $(this).attr("cityid");
    var cityName = $(this).attr("cityname");
    $("input[citynum="+_cityNum+"]").attr("cityId", cityId);
    $("input[citynum="+_cityNum+"]").attr("cityName", cityName);
    
    $("input[citynum="+_cityNum+"]").val(cityName);
    $("#searchCityList").remove();
    //执行联动方法
    var func=$("input[citynum="+_cityNum+"]").attr("func");
    if(func){
    	eval(func+"()");
    }
});

//下拉列表隐藏
$("body").click(function(){
	var t = event.target;
	if($(t).closest('#searchCityList').length > 0){
		return;
	}
	
	$("#searchCityList").hide();
	if($("input[citynum="+_cityNum+"]").val()==""){
		$("input[citynum="+_cityNum+"]").attr("cityid","");
		$("input[citynum="+_cityNum+"]").attr("cityname","");
	}
});
/**
  *@date:2015-05-05
  *@Modify by peanut lastdate :2015-11-13 添加input框城市下拉列表功能
  *@author :Green.Ge
  *@describe：根据输入的品名首字母或中文，从品名列表中查询匹配的值，显示在弹出层上
  *@param: input 选择的输入框
  *@return：null
  *
  */
function showPYMatchList(input) {
	var matchStr = input.val();
	
	var count = 0;
	var searchHtml="";
	if(Context.CITYDATA.length>0){
		$("#searchCityList").remove();   // 先清除该元素，防止出现多个
		var inputId = "city" + new Date().getTime();
		searchHtml = "<div id='searchCityList' class='product-complete' style='z-index:2222;' inputid='" + inputId + "'>";
        searchHtml += "<ul>";
	}
	$(Context.CITYDATA).each(function (i, e) {
		if (filter(e.name, matchStr)) {
			//只取10条
			if (count < 10) {
			searchHtml += "<li><a href='javascript:;' ";
			searchHtml += " cityid='" + e.id + "'";
			searchHtml += " cityname='" + e.name + "'";
			searchHtml += " >";
			searchHtml += "<em class='label-orange white'>城</em>";
			searchHtml += processStr(matchStr, e.name);
			searchHtml += "</a></li>";
			count++;
			}
		}
	});
	 searchHtml += "</ul>";
     searchHtml += "</div>";
     $("body").append($(searchHtml));
     setLayerPosition( input, $("#searchCityList"));
     controlLayerShow($("#searchCityList"));
			
}

//控制显示浮层位置
function setLayerPosition(placeElement, offsetElement) {
	var offset = $(placeElement).offset();
	var offsetTop = $(placeElement).height() + offset.top + 10;
	var offsetLeft = offset.left;
	$(offsetElement).css({
		"top" : offsetTop,
		"left" : offsetLeft
	});
}

// 控制浮层显示隐藏
function controlLayerShow(showLayer) {
	$(".product-complete").hide();
	$(showLayer).show();
}
/*判断是否匹配*/
function filter(fullStr,matchStr){
	if($.trim(matchStr)===""){
		return true;
	}
	var result = false;
	if($.trim(fullStr)!=""){
		if(matchStr.hasChinese()){
			if(fullStr.toLowerCase().indexOf(matchStr.toLowerCase())>-1){
				result=true;
			}
		}else{
			var filters = convertToPY(fullStr);
			if(filters!=null){
				$(filters).each(function(i,e){
					if(e.toLowerCase().indexOf(matchStr.toLowerCase())===0){
						result=true;
						return false;
					}
				})
			}
		}

	}
	return result;
}
/**
  *@date:2015-05-05
  *@Modify-lastdate :2015-05-13
  *@author :Green.Ge
  *@describe：中文转成拼音首字母
  *@param: 要转换的汉字
  *返回值：转换后的拼音首字母
  *
  */
function convertToPY (str) {
	if (typeof (str) !== "string")
		throw new Error(-1, "函数makePy需要字符串类型参数!");
	var arrResult = [];
	for (var i = 0, len = str.length; i < len; i++) {
		var ch = str.charAt(i);
		arrResult.push(checkCh(ch));
	}
	return mkRslt(arrResult);
}

//自定义去空格方法
String.prototype.replaceAll  = function (s1, s2) {
	return this.replace(new RegExp(s1, "gm"), s2);
};

function checkCh(ch) {
	var uni = ch.charCodeAt(0);
	if (uni > 40869 || uni < 19968) {
		return ch;
	}
	return (oMultiDiff[uni] ? oMultiDiff[uni]
			: (strChineseFirstPY.charAt(uni - 19968)));
}

//判断字符串是不是中文
String.prototype.hasChinese = function () {
	var reg = /[^\x00-\xff]/ig;//判断是否存在中文和全角字符
//    var reg=/[A-Za-z]*[a-z0-9_-]|\s$/;//判断是否包含数字字母下划线  当使用这个时如果只有部分是中文字符还可以使用英文字体
	if (reg.test(this)) {
		return true;//存在中文
	}
	return false;//不存在中文
};
function mkRslt(arr) {
	var arrRslt = [ "" ];
	for (var i = 0, len = arr.length; i < len; i++) {
		var str = arr[i];
		var strlen = str.length;
		if (strlen === 1) {
			for (var k = 0; k < arrRslt.length; k++) {
				arrRslt[k] += str;
			}
		} else {
			var tmpArr = arrRslt.slice(0);
			arrRslt = [];
			for (var m = 0; m < strlen; m++) {
				var tmp = tmpArr.slice(0);
				for (var j = 0; j < tmp.length; j++) {
					tmp[j] += str.charAt(m);
				}
				arrRslt = arrRslt.concat(tmp);
			}
		}
	}
	return arrRslt;
}

